pragma solidity 0.5.7;
pragma experimental ABIEncoderV2;

import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/IERC20.sol";
import "abdk-libraries-solidity/ABDKMathQuad.sol";
import "../interfaces/IOrderPool.sol";
import "../interfaces/ITrade.sol";
import "../interfaces/ViaCash.sol";
import "../interfaces/ViaFactory.sol";
import "../registry/Security.sol";
import "../utilities/StringUtils.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";

contract OrderPool is Initializable, IOrderPool {

    using ABDKMathQuad for uint256;
    using ABDKMathQuad for int256;
    using ABDKMathQuad for bytes16;

    using stringutils for *;

    using SafeMath for uint256;

    //mapping security token to cash token pairs
    mapping(address => address) private pair;

    //security trading status
    bool status = true;

    struct order{
        address party;
        bytes16 price;
        bytes16 trigger; 
        bytes32 otype;
        bytes32 order;
        bytes32 status;
        uint256 qty;
        uint dt;
    }

    mapping(bytes32 => order) private orders;

    mapping(address => bytes32) private refs;

    bytes32[] orderRefs;

    //initialized 
    address trade;
    address posttrade;
    bytes32 settlementType;
    address security;
    address factory;

    function initialize(address _security, address _cash, address _trade, address _posttrade, bytes32 _settlementType, address _viaFactory) public initializer{
        security = _security;
        pair[_security]=_cash;
        trade = _trade;
        posttrade = _posttrade;
        settlementType = _settlementType;
        factory = _viaFactory;
    }

    function newOrder(  address _security, 
                        address _cash, 
                        uint256 _price,
                        uint256 _trigger, 
                        uint256 _qty, 
                        bytes32 _otype, 
                        bytes32 _order) external{
        require(_otype=="Market" || _otype=="Limit" || _otype=="StopLoss");
        require(_order=="Buy" || _order=="Sell");
        require(pair[_security]==_cash);
        if(_order=="Buy")
            require(ViaCash(_cash).balanceOf(msg.sender)>=SafeMath.mul(_price, _qty));
        else if(_order=="Sell")
            require(IERC20(_security).balanceOf(msg.sender)>=_qty);
        bytes32 ref = keccak256(abi.encodePacked(msg.sender, now));
        refs[msg.sender]=ref;
        orderRefs.push(ref);
        orders[ref] = order(msg.sender, ABDKMathQuad.fromUInt(_price), ABDKMathQuad.fromUInt(_trigger), _otype, _order, "Open", _qty, now);
        bytes32 s = matched(ref);
        while(s=="PartlyFilled"){ 
            s = matched(ref);
        }
        if(s=="Open" || s=="Filled"){
            ITrade.order memory orderNew = ITrade.order({
                party : orders[ref].party,
                security : security,
                price : ABDKMathQuad.toUInt(orders[ref].price),
                trigger : ABDKMathQuad.toUInt(orders[ref].trigger), 
                otype : orders[ref].otype,
                order : orders[ref].order,
                status : s,
                currency : ViaFactory(factory).getName(pair[security]),
                securityName : Security(security).name().stringToBytes32(),
                qty : orders[ref].qty,
                dt : orders[ref].dt
            });
            ITrade(trade).reportOrder(orderNew, ref);
        }
    }

    function getOrderRef() external view returns(bytes32){
        return refs[msg.sender];
    }    

    function cancelOrder(bytes32 ref) external {        
        require(orders[ref].party==msg.sender);
        for(uint i=0; i<orderRefs.length; i++){
            if(orderRefs[i]==ref){
                orders[orderRefs[i]].status="Cancelled";
                ITrade(trade).cancelOrder(ref, "Cancelled");
                delete orders[orderRefs[i]];
            }
        }
    }   

    function editOrder( bytes32 ref,
                        uint256 _price,
                        uint256 _trigger, 
                        uint256 _qty, 
                        bytes32 _otype,
                        bytes32 _order) external {
        require(_otype=="Market" || _otype=="Limit" || _otype=="StopLoss");
        require(_order=="Buy" || _order=="Sell");
        require(orders[ref].status=="Open");
        if(_order=="Buy")
            require(ViaCash(pair[security]).balanceOf(msg.sender)>=SafeMath.mul(_price, _qty));
        else if(_order=="Sell")
            require(IERC20(security).balanceOf(msg.sender)>=_qty);
        if(orders[ref].party==msg.sender){
            orders[ref] = order(msg.sender, ABDKMathQuad.fromUInt(_price), ABDKMathQuad.fromUInt(_trigger), _otype, _order, orders[ref].status, _qty, now);       
            ITrade.order memory currentOrder = ITrade.order({
                party : orders[ref].party,
                security : security,
                price : ABDKMathQuad.toUInt(orders[ref].price),
                trigger : ABDKMathQuad.toUInt(orders[ref].trigger), 
                otype : orders[ref].otype,
                order : orders[ref].order,
                status : "Open",
                currency : ViaFactory(factory).getName(pair[security]),
                securityName : Security(security).name().stringToBytes32(),
                qty : orders[ref].qty,
                dt : orders[ref].dt
            });
            ITrade(trade).editOrder(currentOrder, ref);
        }
    }

    function matched(bytes32 _ref) private returns(bytes32){
        if(orders[_ref].otype=="Market"){
            bytes32 bestBid;
            bytes16 bestBidPrice = ABDKMathQuad.fromUInt(0);
            bytes32 bestOffer;
            bytes16 bestOfferPrice = ABDKMathQuad.fromUInt(0);
            for(uint i=0; i<orderRefs.length; i++){
                if(orderRefs[i]!=_ref && orders[orderRefs[i]].party!=orders[_ref].party){
                    if(orders[orderRefs[i]].order=="Buy" && orders[_ref].order=="Sell"){
                        if(ABDKMathQuad.cmp(orders[orderRefs[i]].price, orders[_ref].price)==0 ||
                             ABDKMathQuad.cmp(orders[orderRefs[i]].price, orders[_ref].price)==1){
                            if(ABDKMathQuad.cmp(orders[orderRefs[i]].price, bestBidPrice)==1){
                                bestBidPrice = orders[orderRefs[i]].price;
                                bestBid = orderRefs[i];
                            }
                        }
                    }
                    else if (orders[orderRefs[i]].order=="Sell" && orders[_ref].order=="Buy"){
                        if(ABDKMathQuad.cmp(orders[orderRefs[i]].price, orders[_ref].price)==0 ||
                            ABDKMathQuad.cmp(orders[orderRefs[i]].price, orders[_ref].price)==-1){
                            if(ABDKMathQuad.cmp(orders[orderRefs[i]].price, bestOfferPrice)==1){
                                bestOfferPrice = orders[orderRefs[i]].price;
                                bestOffer = orderRefs[i];
                            }
                        }
                    }
                }
            }
            if(orders[_ref].order=="Sell"){
                if(bestBid!=""){
                    if(orders[bestBid].qty >= orders[_ref].qty){
                        orders[bestBid].qty = orders[bestBid].qty - orders[_ref].qty;
                        uint qty = orders[_ref].qty;
                        orders[_ref].qty = 0;
                        orders[bestBid].status = "Filled";
                        orders[_ref].status = "Filled";
                        reportTrade(_ref, orders[_ref].party, bestBid, orders[bestBid].party, orders[_ref].price, qty, orders[_ref].order, settlementType);
                        return "Filled";
                    }
                    else{
                        orders[_ref].qty = orders[_ref].qty - orders[bestBid].qty;
                        uint qty = orders[bestBid].qty;
                        orders[bestBid].qty = 0;
                        orders[bestBid].status = "PartlyFilled";
                        orders[_ref].status = "PartlyFilled";
                        reportTrade(_ref, orders[_ref].party, bestBid, orders[bestBid].party, orders[_ref].price, qty, orders[_ref].order, settlementType);
                        return "PartlyFilled";
                    }
                }
            }
            else if(orders[_ref].order=="Buy"){
                if(bestOffer!=""){
                    if(orders[bestOffer].qty >= orders[_ref].qty){
                        orders[bestOffer].qty = orders[bestOffer].qty - orders[_ref].qty;
                        uint qty = orders[_ref].qty;
                        orders[_ref].qty = 0;
                        orders[bestOffer].status = "Filled";
                        orders[_ref].status = "Filled";
                        reportTrade(bestOffer, orders[bestOffer].party, _ref, orders[_ref].party, orders[_ref].price, qty, orders[_ref].order, settlementType);
                        return "Filled";
                    }
                    else{
                        orders[_ref].qty = orders[_ref].qty - orders[bestOffer].qty;
                        uint qty = orders[bestOffer].qty;
                        orders[bestOffer].qty = 0;
                        orders[bestOffer].status = "PartlyFilled";
                        orders[_ref].status = "PartlyFilled";
                        reportTrade(bestOffer, orders[bestOffer].party, _ref, orders[_ref].party, orders[_ref].price, qty, orders[_ref].order, settlementType);
                        return "PartlyFilled";
                    }
                }
            }
        }
        return "Open";
    }

    function reportTrade(bytes32 _pregRef,
                        address _transferor, 
                        bytes32 _cpregRef,
                        address _transferee, 
                        bytes16 _price,
                        uint256 _qty,
                        bytes32 _order,
                        bytes32 _type) private {
        uint256 _askprice = 0;
        if(_order=="Buy"){
            _askprice = ABDKMathQuad.toUInt(orders[_pregRef].price);
        }
        else if(_order=="Sell"){
            _askprice = ABDKMathQuad.toUInt(orders[_cpregRef].price);
        }
        ITrade.trade memory newTrade = ITrade.trade({
            transferor : _transferor,
            transferee : _transferee,
            security : security,
            price : ABDKMathQuad.toUInt(_price),
            askprice : _askprice,
            currency : ViaFactory(factory).getName(pair[security]),
            order : _order,
            stype : _type,
            qty : _qty,
            dt : now
        });
        ITrade(trade).reportTrade(newTrade, _pregRef, _cpregRef);
    }

    function revertTrade(bytes32 _orderRef, uint256 _qty, bytes32 _order) external {
        require(_order=="Buy" || _order=="Sell");
        require(trade==msg.sender);
        for(uint i=0; i<orderRefs.length; i++){
            if( orderRefs[i]==_orderRef &&
                orders[orderRefs[i]].order==_order){
                    orders[orderRefs[i]].qty=orders[orderRefs[i]].qty+_qty;
                    orders[orderRefs[i]].status="Open";
            }
        }
    }
    
    function orderFilled(bytes32 partyRef, bytes32 counterpartyRef) external {
        require(trade==msg.sender || posttrade==msg.sender);
        delete orders[counterpartyRef];
        delete orders[partyRef];
    }
}
